	add("outrage", "{\"term\":\"outrage\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) and Old french (842-ca. 1400) \u0027oltrage\u0027 (lang\u003dfro) from \u0027*ultragium\u0027 or \u0027*ultraticum\u0027 (\u0026quot;a going beyond\u0026quot;) and from Latin \u0027ultra\u0027 (lang\u003dla) rather than from out and rage. The verb is from Old french (842-ca. 1400) \u0027oltragier\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An excessively violent or vicious attack; an atrocity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An offensive, immoral or indecent act\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The resentful anger aroused by such acts\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A destructive rampage\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;by the outrage and fury of the river Effra\u0026quot; (from an old description of flood damage\", \"priority\":5}]}, \"synonyms\":{}}");

