	add("outrager", "{\"term\":\"outrager\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|outrage|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who outrages\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Sir Walter Scott, \u0027Peveril of the Peak\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Blasphemers, robbers and oppressors, \u0027\u0027outragers\u0027\u0027 of the female sex, and scoffers at regular authority\", \"priority\":3}]}, \"synonyms\":{}}");

	add("outrance", "{\"term\":\"outrance\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027oltrance\u0027 (modern \u0027oltrance\u0027 , from \u0027outrer\u0027 (pass beyond) from \u0027oltre\u0027 \u0027outre\u0027 \u0027utre\u0027 lt;!--etc.--\u0026gt;, from \u0027ultra-\u0027 Compare \u0027outrage\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The furthest degree or extremity, going beyond bounds or propriety\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1819\u0027\u0027: But if the shield was touched with the sharp end of the lance, the combat was understood to be at “\u0027\u0027outrance\u0027\u0027”, that is, the knights were to fight with sharp weapons, as in actual battle. — Walter Scott, \u0027Ivanhoe\", \"priority\":2}]}, \"synonyms\":{}}");

	add("outreach", "{\"term\":\"outreach\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027out\u0027 + \u0027reach\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or practice of visiting and providing the services (of a charity or other organization) to people who might not otherwise have access to those services\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The extent or length of something\", \"priority\":2}]}, \"synonyms\":{}}");

	add("outrecuidance", "{\"term\":\"outrecuidance\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) {{m|fro|outrecuidance}} (whence modern French {{m|fr|outrecuidance}}), from {{m|fro|outre}} + {{m|fro|cuidier||think}}, from Latin {{m|la|cogitare}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Presumption, arrogance, self-conceit\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1819\u0027\u0027, Walter Scott, \u0027Ivanhoe\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"“It is full time,” said De Bracy, “that the \u0027\u0027\u0027outrecuidance\u0027\u0027\u0027 of these peasants should be restrained by some striking example\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1897\u0027\u0027, Rudyard Kipling, \u0027.007\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"“But, with my constitution and temperament - my work lies in Boston - I find your \u0027\u0027\u0027outrecuidance\u0027\u0027\u0027 -\u0026quot\", \"priority\":5}]}, \"synonyms\":{}}");

