	add("outside", "{\"term\":\"outside\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{m|en|out}} + {{m|en|side}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The part of something that faces out; the outer surface\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1653\u0027\u0027, (translator), \u0027s:Gargantua/The Author\u0027s Prologue to the First Gargantua\u0027, \u0026quot;The Author\u0027s Prologue to the First Book\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Silenes of old were little boxes, like those we now may see in the shops of apothecaries, painted on the \u0027\u0027outside\u0027\u0027 with wanton toyish figures, as harpies, satyrs, bridled geese, horned hares, saddled ducks, flying goats, thiller harts, and other such-like counterfeited pictures at discretion\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1890\u0027\u0027, \u0027s:How the Other Half Lives/Chapter How the Other Half Lives\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027outside\u0027\u0027 of the building gives no valuable clew\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1911\u0027\u0027, \u0027s:1911 Encyclopædia Cab\u0027, article in\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The number of persons which the cab is licensed to carry must be painted at the back on the \u0027\u0027outside\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The external appearance of something\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The space beyond some limit or boundary\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Spectator\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"I threw open the door of my chamber, and found the family standing on the \u0027\u0027outside\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Have you seen my wife, Mr Jones? / Do you know what it\u0027s like on the \u0027\u0027outside\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Four buffalo gals go \u0027round the \u0027\u0027outside\u0027\u0027 / \u0027Round the \u0027\u0027outside\u0027\u0027 / \u0027Round the \u0027\u0027outside\u0027\u0027 / Four buffalo gals go \u0027round the \u0027\u0027outside\u0027\u0027 / And do-si-do your partners\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The furthest limit, as to number, quantity, extent, etc\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"It may last a week at the \u0027\u0027outside\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A passenger riding on the outside of a coach or carriage\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027outsides\u0027\u0027 did as \u0027\u0027outsides\u0027\u0027 always do. They were very cheerful and talkative at the beginning of every stage, and very dismal and sleepy in the middle\", \"priority\":17}]}, \"synonyms\":{}}");

	add("outsideness", "{\"term\":\"outsideness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|outside|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being outside\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Mary Roberts, \u0027Intimate outsiders\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Outsideness\u0027\u0027, however, does not necessarily equate with powerlessness\", \"priority\":3}]}, \"synonyms\":{}}");

	add("outsider", "{\"term\":\"outsider\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|outside|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who is not part of a community or organization\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"While the initiated easily understand the symbols, they are wholly inaccessible to \u0027\u0027outsiders\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A newcomer with little or no experience in an organization or community\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Seeing the mess professional politicians have made of things is it any wonder the electorate is beginning to prefer \u0027\u0027outsiders\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A competitor or contestant who has little chance of winning; a long shot; a dark hors\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Johnny was an \u0027\u0027outsider\u0027\u0027 at this years karate tournament, but he still managed to win second place out of sheer determination\", \"priority\":6}]}, \"synonyms\":{}}");

