	add("outtake", "{\"term\":\"outtake\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027outtaken\u0027 (to take out) equivalent to {{prefix|out|take|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A portion of a recording (a take) that is not included in the final version of a film or a musical album, often because it contains a mistake\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The DVD for that movie has ten minutes worth of \u0027\u0027outtakes\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A complete version of a recording or film that is dropped in favour of another version, reject\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An opening for outward discharge, vent\", \"priority\":4}]}, \"synonyms\":{}}");

